import { FC, useEffect, useRef, useState } from "react";
import { ClipTypeObj } from "../../types/ClipTypes";
import { getData } from "../../utils/data-utils";
import "./DecideReel.css";

const SelectClips: FC = () => {
  const [clipList, setClipList] = useState([]);

  useEffect(() => {
    fetch("http//localhost:8000/select-clips")
      .then((res) => res.json())
      .then((res) => setClipList(res));
  }, []);
  
  return (
    <div className="container">
      {clipList.map(clip => {return <span>{clip}</span>})}
    </div>
  );
};

export default SelectClips;
